import React from 'react';
import Navbar from '../../components/Navbar';
import Button from 'react-bootstrap/Button';
import $ from 'jquery';
import '../../css/App.css';
import { useEffect } from 'react';
import colorspectrum from '../../images/resized/Spectrum.png';
import exampleImage from '../../images/resized/Zebra.jpg';
import { useNavigate } from 'react-router-dom';

const Home = () => {
	useEffect(() => {
		createPixelMask();
	}, [])

	let navigate = useNavigate();

	function createPixelMask(){
		var table = document.getElementById("pixel_Table");
		var row;
		var cell;
    	for(var i=0;i<8;i++){
			row = table.insertRow(i);
      		for(var j=0;j<8;j++){
			    cell = row.insertCell(j);
			    cell.addEventListener('click', IncreaseOpacity);
				cell.addEventListener('contextmenu', DecreaseOpacity)
        	}
    	}

    	document.getElementById("pixel_Table").style.backgroundImage = 'url(' + exampleImage + ')';
    }
		
	function DecreaseOpacity(event) {
		event.preventDefault()
		var opacity_level = parseFloat($(event.target).css("opacity"));
		if (opacity_level > "0.0") {
			opacity_level = opacity_level - 0.30;
			$(event.target).css("opacity", opacity_level);
		}
	}
		
	function IncreaseOpacity(event) {
		var opacity_level = parseFloat($(event.target).css("opacity"));
		if (opacity_level < "0.9") {
			opacity_level = opacity_level + 0.30;
			$(event.target).css("opacity", opacity_level);
		}	
	}

    return (
        <div className="home">		
            <Navbar/>
            <div style={{height: "40vw", position: "relative"}}>
                <div style={{position: "absolute", top: "50%", left: "50%", transform: "translate(-50%, -50%)", textAlign: "center"}}>
					<div className="row">
						<div style={{float: "left", width: "50%", textAlign: "left"}}>
							<p>Enkäten består av 5 bilder, där du som respondent med hjälp av ett rutnät får markera vilka delar av bilden du nyttjar för att identifiera ett djur på en bild, samt hur viktig varje ruta är för identifieringen. Du behöver inte ha några förkunskaper inom AI för att utföra enkäten. Det vi är intresserade av är hur du som människa resonerar.</p>
							<br></br>
							<p>Ditt uppdrag är inte att identifiera djuren, utan att indikera vilka delar av en bild du behöver, och till vilken grad, för att utföra identifikationen. Detta gör du genom att klicka på rutorna i bilden. Det finns 4 nivåer av markering, där ingen markering är nivå 1. Vänsterklick ökar nivån för en ruta med ett steg, medan högerklick minskar ett steg. Högre nivå indikerar att rutan är viktigare för att kunna identifiera djuret.</p>
							<br></br>
							<p>På exemplet nedan kan du klicka runt och testa hur undersökningen kommer att fungera. På samtliga bilder får du markera hur många rutor du vill (dock minst en), och helt fritt markera vilka nivåer som helst i vilken kombination som helst.</p>
							<br></br>
							<p>Har du frågor innan du påbörjar enkäten kan du kontakta oss på <u>xaiundersokning@gmail.com</u></p>
							<br></br>	
						</div>
						<div style={{float: "left", width: "50%"}}>
							<h5>Exempel bild</h5>
							<table id="pixel_Table"></table>
							<figure>
							<img src={colorspectrum} alt="Spektrum"/>
								<figcaption><h5>Gradskala</h5></figcaption>
							</figure>
							<br></br>
							<p>
							Tryck på “Starta enkäten” när du är redo.
							</p>
							<br></br>
							<Button variant="outline-secondary" onClick={() => {
								navigate('/survey');
							}}
							>Starta enkäten</Button> 	
						</div>
					</div>
					
                </div> 
            </div>          
        </div>
    )
}

export default Home;
